// LoginPage.js
import React from 'react';
import { useHistory } from 'react-router-dom';

const LoginPage = () => {
  const history = useHistory();

  const handleLogin = (userType) => {
    // For simplicity, we're just storing the user type in localStorage
    localStorage.setItem('userType', userType);
    history.push('/foods');
  };

  return (
    <div>
      <h1>Login Page</h1>
      <button onClick={() => handleLogin('nutritionist')}>Login as Nutritionist</button>
      <button onClick={() => handleLogin('person')}>Login as Person</button>
    </div>
  );
};

export default LoginPage;
